                'aragon': [249.000000, 82.000000],
                'catalunya': [320.000000, 69.000000],
                'castilla-y-leon': [122.000000, 73.000000],
                'la-rioja': [192.000000, 60.000000],
                'comunidad-de-madrid': [155.000000, 123.000000],
                'extremadura': [79.000000, 176.000000],
                'castilla-la-mancha': [183.000000, 162.000000],
                'comunidad-valenciana': [248.000000, 170.000000],
                'andalucia': [134.000000, 247.000000],
                'region-de-murcia': [227.000000, 230.000000],
                'illes-balears': [349.000000, 145.000000],
                'canarias': [359.000000, 295.000000],
            },
        };
    },
    emits: ['clickOnState'],
    props: {
        counters: Array,
        counterBgColor: {
            type: String,
            default: '#69979D',
        },
    },
    watch: {
        counters() {
            Object.keys(this.coordinates).forEach((k) => {
                let selected = this.structuredCounters.some((f) => f.code === k),
                    polyline = document.getElementById(this.idPrefix + k);

                if (!polyline) {
                    return;
                }

                if (!selected) {
                    polyline.setAttribute('fill', '#D4D1C7');
                } else {
                    polyline.setAttribute('fill', '#B6CDD0');
                }
            });
        },
    },
    computed: {
        idPrefix() {
            return 'regionsvg-' + this.randomId;
        },
        structuredCounters() {
            if (!this.counters) return [];

            return this.counters.map(counter => {
                let code = removeAccents(counter.name).toLowerCase().split('ñ').join('n').split(' ').join('-');
                code = this.aliases[code] || code;

                return {
                    name: counter.name,
                    count: counter.count,
                    references: counter.references,
                    code,
                };
            });
        },
    },
    methods: {
        click(key) {
            this.$emit('clickOnState', key);
            let references = this.structuredCounters.filter(c => c.code === key)[0].references;

            if (references) {
                this.$router.push({
                    name: 'AssetIndex',
                    hash: '#?references=' + references.join(','),
                });
            }
        },
    },
}
</script>

